import styled from "styled-components";

const Button = styled.button`
  background: linear-gradient(to right, #2948ff, #396afc);
  width: 50%;
  height: 100px;
  color: white;
  font-weight: 500;
  font-family: inherit;
  border: 0;
  border-radius: 5px;
  font-size: 200%;
  padding: 5px;
  margin-top: 10px;
  margin-bottom: 10px;
`;

export default Button;
